description:
Verenigde Staten
Drama / Thriller
100 minuten

goed

met Diane Kruger, Dermot Mulroney en Rosanna Arquette

Het stel Paul en Diane Stanton heeft een ziek dochtertje Cloe, dat een longziekte heeft. Paul werkt als advocaat en wil graag 
dat hun dochtertje snel geholpen wordt voordat het te laat is. De donorwachtlijst lijkt eeuwig te duren en het stel hoort van 
een arts dat een bekende van het stel 7 jaar op de wachtlijst heeft gestaan, maar er toen ineens vanaf was. Zo komen ze erachter 
dat deze bekende een transplantatie in Mexico gehad heeft. Paul gaat op zoek in het corrupte Mexico, naar de dokter die dit 
mogelijk kan maken. Ondertussen gaat het bergafwaarts met hun dochter Cloe. Paul stelt alles in het werk om een,illegale, donor 
te vinden voor hun dochter. Gaat het hun lukken om hun dochtertje te redden?
